    }

    /* Main Text */
    .title-29uC1r,
    .name-3Uvkvr,
    .header-2o-2hj,
    .channelName-2YrOjO,
    .topic-2Wo3A1,
    .text-sm-normal-3Zj3Iv {
        color: #1b5e20 !important;
    }

    /* Secondary Text */
    .text-muted-2lC8pA,
    .content-3YMskv,
    .header-3p9b-K,
    .markup-2BOw-j,
    .modeDefaultTextArea-1eyzmX {
        color: #2e7d32 !important;
